<template>
    <div class="container">
        <div class="row py-4">
            <div class="col-sm-5">
                <h3>{{ __('api.requests') }}</h3>
                <label for="api_token">{{ __('api.token') }}</label>
                <textarea class="form-control btn-block" placeholder="Api token" @change="changeApiToken($event)"
                          type="text" name="api_token" id="api_token" v-model="api_token"></textarea>
                <label for="product" class="mt-2">{{ __('api.id_product') }}</label>
                <input class="form-control btn-block" placeholder="Id de producto"
                          type="number" name="product" id="product" v-model="product_id" min="0"
                @change="changeProductId($event)">

                <label class="mt-4" for="methods">{{ __('api.options') }}</label>
                <select class="form-control" id="methods" @change="onSelectOption($event)">
                    <option value="">{{ __('api.choose_option') }}</option>
                    <option value="list">{{ __('api.list') }}</option>
                    <option value="show">{{ __('api.view') }}</option>
                    <option value="store">{{ __('api.create') }}</option>
                    <option value="update">{{ __('api.update') }}</option>
                    <option value="delete">{{ __('api.delete') }}</option>
                    <option value="image">{{ __('api.send_images') }}</option>
                    <option value="categories">{{ __('api.view_category') }}</option>
                    <option value="tags">{{ __('api.view_tags') }}</option>
                    <option value="sizes">{{ __('api.view_sizes') }}</option>
                    <option value="colors">{{ __('api.view_colors') }}</option>
                </select>

                <div class="input_group" v-show="showImages">
                    <label class="mt-4" for="images">{{ __('api.add_images') }}</label>
                    <input class="form-control d-block mr-sm-2" type="file" name="images[]" multiple
                           id="images" accept="image/x-png, image/gif, image/jpeg" @change="convertImagesToBase64($event)">
                </div>
                <div class="container mt-4">
                  <tr>
                    <th>{{ __('Http Method:') }}</th>
                    <td class="pl-4">{{ httpMethod }}</td>
                  </tr>
                  <div v-show="httpMethod === 'DELETE'">
                    <tr>
                      <th>{{ __('Headers') }}</th>
                      <td></td>
                    </tr>
                    <tr>
                      <th>{{ __('Authorization:') }}</th>
                      <td class="pl-4">{{ __('Bearer + api_token') }}</td>
                    </tr>
                  </div>
                  <div class="pre pre-scrollable p-2 mb-2" id="request">
                  </div>
                </div>
                <button class="btn btn-success btn-block" type="button" @click="sendRequest(method)">{{ __('actions.submit') }}</button>
            </div>
            <div class="col-sm-7">
                <h3>{{ __('api.response') }}</h3>
                <div id="response" class="container p-2" style="max-height: 700px; overflow: auto">
                </div>
            </div>
        </div>
    </div>
</template>
<script>

import axios from 'axios'

export default {
  name: 'test-api-component',
  data () {
    return {
      api_token: '',
      baseApiUrl: `${process.env.MIX_APP_URL}/api/`,
      baseUrlProducts: `${process.env.MIX_APP_URL}/api/products`,
      request: {},
      response: {},
      method: 'list',
      httpMethod: 'GET',
      product_id: 0,
      showImages: false,
      image1: 'data:image/png;base64,',
      images: []
    }
  },

  methods: {
    onSelectOption: function (event) {
      this.httpMethod = 'GET'
      this.showImages = false
      switch (event.target.value) {
        case 'list':
          this.request = {
            url: this.baseUrlProducts
          }
          this.method = 'list'
          break
        case 'show':
          this.request = {
            url: this.baseUrlProducts + '/' + this.product_id
          }
          this.method = 'show'
          break
        case 'store':
          this.images = []
          this.images.push(this.image1)
          this.request = {
            url: this.baseUrlProducts,
            data: {
              api_token: this.api_token,
              reference: Math.round(Math.random() * 100000),
              name: 'New product',
              description: 'New product created from test api',
              cost: 15000,
              price: 40000,
              id_category: 5,
              tags: ['Hombre'],
              stocks: [
                {
                  color: 'RED',
                  size: {
                    type: 'Zapatos',
                    size: '40'
                  },
                  quantity: 3
                }
              ],
              photos: this.images
            }
          }
          this.method = 'store'
          this.httpMethod = 'POST'
          break
        case 'update':
          this.request = {
            url: this.baseUrlProducts + '/' + this.product_id,
            data: {
              api_token: this.api_token,
              reference: Math.round(Math.random() * 100000),
              name: 'New product updated',
              description: 'New product updated from test api',
              cost: 15000,
              price: 40000,
              id_category: 5,
              tags: ['Hombre']
            }
          }
          this.method = 'update'
          this.httpMethod = 'PUT'
          break
        case 'delete':
          this.request = {
            url: this.baseUrlProducts + '/' + this.product_id
          }
          this.httpMethod = 'DELETE'
          this.method = 'delete'
          break
        case 'image':
          this.showImages = true
          this.method = 'images'
          this.httpMethod = 'POST'
          this.images = []
          this.request = {
            url: this.baseUrlProducts + '/photos',
            data: {
              api_token: this.api_token,
              product_id: this.product_id,
              photos: this.images
            }
          }
          break
        case 'categories':
          this.method = 'list'
          this.request = {
            url: this.baseApiUrl + 'categories'
          }
          break
        case 'tags':
          this.method = 'list'
          this.request = {
            url: this.baseApiUrl + 'tags'
          }
          break
        case 'sizes':
          this.method = 'list'
          this.request = {
            url: this.baseApiUrl + 'type_sizes'
          }
          break
        case 'colors':
          this.method = 'list'
          this.request = {
            url: this.baseApiUrl + 'colors'
          }
          break
        default:
          this.request = {}
          this.response = {}
      }
      const str = JSON.stringify(this.request, undefined, 4)
      this.printJson('request', this.syntaxHighlight(str))
    },
    sendRequest: function (method) {
      switch (method) {
        case 'list':
          axios.get(this.request.url).then(res => {
            this.response = res.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          }).catch(err => {
            this.response = err.response.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          })
          break
        case 'show':
          axios.get(this.request.url).then(res => {
            this.response = res.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          }).catch(err => {
            this.response = err.response.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          })
          break
        case 'store':
          axios.post(this.request.url, this.request.data).then(res => {
            this.response = res.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          }).catch(err => {
            this.response = err.response.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          })
          break
        case 'update':
          axios.put(this.request.url, this.request.data).then(res => {
            this.response = res.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          }).catch(err => {
            this.response = err.response.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          })
          break
        case 'delete':
          axios.delete(this.request.url, {
            headers: {
              Authorization: 'Bearer ' + this.api_token
            }
          }).then(res => {
            this.response = res.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          }).catch(err => {
            this.response = err.response.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          })
          break
        case 'images':
          axios.post(this.request.url, this.request.data).then(res => {
            this.response = res.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          }).catch(err => {
            this.response = err.response.data
            const str = JSON.stringify(this.response, undefined, 4)
            this.printJson('response', this.syntaxHighlight(str))
          })
          break
      }
    },

    convertImagesToBase64: function (e) {
      const files = e.target.files
      this.images = []
      for (let i = 0; i < files.length; i++) {
        const reader = new FileReader()
        reader.readAsDataURL(files[i])
        reader.onload = () => {
          this.images.push(reader.result)
          this.request.data.photos = this.images
        }
      }
    },

    changeProductId: function (e) {
      this.product_id = e.target.value
      if (this.method.toString() !== 'list') {
        if (this.method.toString() === 'show' || this.method.toString() === 'delete' || this.method.toString() === 'update') {
          this.request.url = this.baseUrlProducts + '/' + this.product_id
        } else {
          this.request.data.product_id = this.product_id
        }
        const str = JSON.stringify(this.request, undefined, 4)
        this.printJson('request', this.syntaxHighlight(str))
      }
    },

    changeApiToken: function (e) {
      this.api_token = e.target.value
      if (this.method.toString() === 'delete') {
        this.request.api_token = this.api_token
      } else {
        this.request.data ? this.request.data.api_token = this.api_token : this.request.api_token = this.api_token
      }
    },

    syntaxHighlight: function (json) {
      json = json.replace(/&/g, '&amp;').replace(/</g, '&lt;').replace(/>/g, '&gt;')
      return json.replace(/("(\\u[a-zA-Z0-9]{4}|\\[^u]|[^\\"])*"(\s*:)?|\b(true|false|null)\b|-?\d+(?:\.\d*)?(?:[eE][+]?\d+)?)/g, function (match) {
        let cls = 'number'
        if (/^"/.test(match)) {
          if (/:$/.test(match)) {
            cls = 'key'
          } else {
            cls = 'string'
          }
        } else if (/true|false/.test(match)) {
          cls = 'boolean'
        } else if (/null/.test(match)) {
          cls = 'null'
        }
        return '<span class="' + cls + '">' + match + '</span>'
      })
    },

    printJson: function (div, json) {
      if (document.getElementById(div).firstChild) {
        document.getElementById(div).removeChild(document.getElementById(div).firstElementChild)
      }
      document.getElementById(div).appendChild(document.createElement('pre')).innerHTML = json
    }
  }
}
</script>
